import React from "react";
import Login from "../components/Login/Login.js";
import Header from "../components/Header/Header.js";
import { BrowserRouter } from "react-router-dom";

const LoginPage = () => {
    return(
        <div>
            <BrowserRouter>
                <Header />
            <Login />
            </BrowserRouter>
        </div>
    )
}

export default LoginPage
